import React from 'react';
import './App.css';
import NavBar from './Components/Navbar'

import 'bootstrap/dist/css/bootstrap.min.css';
import './style.css'

function App() {
  return (
    <div className="App">
     <NavBar/>
     <div>
      <h1 style={{color:"#424761", display}}>Import some data to begin</h1>
     </div>  
    </div>
  );
}

export default App;
